import React from "react";
import Style from '../styles/Card.module.css'
export default function Card({ name , image, diets, health_score }) {
  return(
    <div className={Style.card}>
      <h3 className={Style.subTitle}>{name}</h3>
      {
        !image.length?<img src="https://us.123rf.com/450wm/yehorlisnyi/yehorlisnyi2104/yehorlisnyi210400016/167492439-sin-foto-o-icono-de-imagen-en-blanco-cargando-im%C3%A1genes-o-marca-de-imagen-faltante-imagen-no-disponib.jpg?ver=6"/>
        :<img src={image} alt="recipe image" width='200px' height='250px' />
      }
      <h5 className={Style.diet}>Diets: </h5>
      <h5>{diets}</h5>
      <h5 className={Style.diet}>Health Score: {health_score}</h5>
    </div>
   )
}
